import React from "react";
import styled from "styled-components";

const ImageSliderContainer = styled.section`
  height: 60vh;
  width: 100vw;
  position: relative;
  overflow: hidden;
  img {
    width: 100%;
  }
`;

const ImageSlider = ({ children }) => {
  const handleSlider = () => {};
  return (
    <ImageSliderContainer onClick={handleSlider}>
      {children}
    </ImageSliderContainer>
  );
};

export default ImageSlider;
